import React from 'react';
import ReactDOM from 'react-dom/client';
import './App.css';
import './index.css'
import App from './App';

(document).ready(function(){
  $('.toggle').click(function(){
      $('.menu').toggleClass('active');
  });
});

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);
